* {
  margin: 0;
  padding: 0;
}

body {
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  background: rgba(255, 255, 255, 0.9);
  backdrop-filter: blur(384.02px);
}

/*-------------------------------header styling---------------------------------*/
header {
  display: flex;
  justify-content: space-around;
  align-items: center;
  height: 70px;
}

.header-menu {
  display: flex;
  list-style: none;
}

.header-menu > li {
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-self: center;
  margin-right: 20px;
}

header div {
  width: 100px;
  height: 35px;
  font-family: "Cera Pro";
  font-style: normal;
  font-weight: 400;
  font-size: 30px;
  line-height: 35px;
  text-align: center;
  color: #000000;
}

.header-menu > li > a {
  margin-right: 20px;
  margin-left: 20px;
  text-decoration: none;
  text-transform: uppercase;
  width: 45px;
  height: 20px;
  font-family: "Cera Pro";
  font-style: normal;
  font-weight: 400;
  font-size: 15px;
  line-height: 20px;
  color: #686c75;
}

.header-menu > li > a:hover {
  cursor: pointer;
  color: lightsalmon;
  text-decoration: underline;
}

/*-------------------------------main styling---------------------------------*/
main {
  margin-top: 0;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  height: 595px;
}

/*--------------------------left content of main----------------------------*/
.left-content {
  width: 50%;
  height: 100%;
  display: flex;
  flex-direction: column;
}
#background {
  position: fixed;
  left: 0px;
  width: 50%;
  height: 30%;
  background: #ffdb80;
  filter: blur(1000px);
}

.left-content > .content {
  margin-top: 100px;
  padding-left: 310px;
}

.left-content > .content > p {
  width: 450px;
  height: 250px;
  font-family: "Axiforma";
  font-style: normal;
  font-weight: 700;
  font-size: 60px;
  line-height: 60px;
  color: #000000;
}

.blur-bar {
  margin-top: 15px;
  width: 700px;
  height: 80px;
  background: rgba(243, 243, 243, 0.6);
  backdrop-filter: blur(35.5212px);
  border-radius: 5px;
  margin-left: 280px;
}

.blur-bar > ul {
  display: flex;
  flex-direction: row;
  list-style: none;
}

.blur-bar > ul > li {
  margin-top: 29px;
  margin-right: 130px;
  margin-left: 50px;
  width: 35px;
  height: 25px;
  font-family: "Cera Pro";
  font-weight: 400;
  font-size: 18px;
  line-height: 24px;
  color: #989898;
}

.sceduale-visit {
  margin-top: -8px;
  color: white;
  width: 170px;
  height: 40px;
  background: #fd5b2f;
  border-radius: 5px;
  border: none;
  font-family: "Poppins";
  font-weight: 500;
  font-size: 15px;
  text-align: center;
}

.blur-bar > ul > li:hover {
  transform: scale(1.1);
  transition: 0.8s;
}

.images {
  display: flex;
  flex-direction: row;
  padding-left: 310px;
  margin-top: 30px;
}

.images > ul {
  display: flex;
  flex-direction: row;
}

.images > ul > li {
  margin-left: -10px;
  list-style: none;
}

.images > p {
  padding-top: 10px;
  margin-left: 10px;
  font-family: "Avenir";
  font-style: normal;
  font-weight: bold;
  font-size: 15px;
  color: #000000;
}

/*--------------------------right content of main----------------------------*/
.right-content {
  width: 50%;
  height: 100%;
}
#background2 {
  position: fixed;
  right: 0px;
  width: 50%;
  height: 30%;
  background: #47dff3;
  filter: blur(1000px);
}

.image-border {
  width: 350px;
  height: 520px;
  margin-top: 40px;
}

.first-image {
  width: 370px;
  height: 500px;
  margin-top: 70px;
  margin-left: -330px;
  border-radius: 376.107px 376.107px 0px 0px;
}

.right-content div p {
  position: absolute;
  width: 450px;
  height: 60px;
  right: 130px;
  top: 390px;
  font-family: "Axiforma";
  font-style: normal;
  font-weight: 700;
  font-size: 45px;
  line-height: 68px;
  color: #000000;
  opacity: 0.2;
  transform: rotate(-90deg);
}

.second-image {
  position: absolute;
  margin-left: 200px;
  margin-top: -550px;
  width: 280px;
  height: 280px;
  filter: drop-shadow(0px 56.4161px 87.7584px rgba(255, 200, 118, 0.35));
}
.third-image {
  position: absolute;
  margin-top: -350px;
  right: 228px;
  width: 210px;
  height: 210px;
  filter: drop-shadow(0px 56.4161px 87.7584px rgba(255, 200, 118, 0.35));
}
.fourth-image {
  position: absolute;
  margin-top: -440px;
  right: 190px;
  width: 185px;
  height: 185px;
  filter: drop-shadow(0px 56.4161px 87.7584px rgba(255, 200, 118, 0.35));
}

/*-------------------------------fotter styling---------------------------------*/
.footer {
  margin-top: auto;
  height: auto;
  float: bottom;
}

footer ul {
  margin-right: auto;
  margin-left: auto;
  display: flex;
  flex-direction: row;
  justify-content: center;
  list-style-type: none;
  margin-bottom: 15px;
}

footer ul li {
  margin-left: 80px;
}

footer ul li a img {
  height: 25px;
  width: 100px;
  cursor: pointer;
}

footer ul li a img:hover {
  transform: scale(1.1);
  transition: 0.5s;
}
